import React from 'react';
import { Bar } from 'react-chartjs-2';

const data = {
  labels: ['Artist 1', 'Artist 2', 'Artist 3', 'Artist 4', 'Artist 5'],
  datasets: [
    {
      label: 'Popularity of Songs',
      backgroundColor: '#1DB954',
      data: [12, 19, 3, 5, 2],
    },
    {
      label: 'Duration of Songs',
      backgroundColor: '#191414',
      data: [5, 10, 15, 20, 25],
    },
  ],
};

const options = {
  title: {
    display: true,
    text: 'Popularity and Duration of Songs by Artist',
  },
  scales: {
    xAxes: [
      {
        stacked: true,
        scaleLabel: {
          display: true,
          labelString: 'Artist',
        },
      },
    ],
    yAxes: [
      {
        stacked: true,
        scaleLabel: {
          display: true,
          labelString: 'Value',
        },
        ticks: {
          beginAtZero: true,
        },
      },
    ],
  },
};

const StackedBarChart = () => {
  return <Bar data={data} options={options} />;
};

export default StackedBarChart;
